let blocky_images = {
    blocky_icon: "data:image/png;base64,",
    blocky: "data:image/png;base64,",
    blocky_blink: "data:image/png;base64,"
};
(function() {
    Plugin.register('blocky_forever', {
        title: 'Blocky Forever',
        author: 'JannisX11 & Bug1312',
        variant: 'both',
        about: 'DISCLAIMER: MOST CODE CREATED BY JANNISX11, BUG1312 ONLY PORTED TO PLUGIN',
        description: 'Brings JannisX11\'s April Fools Blocky feature back into BlockBench!',
        icon: Blockbench.getIconNode(blocky_images.blocky_icon),
        onload() {
            if (!document.querySelector(".blocky")) {
                document.querySelector('style').innerHTML += `.preview .blocky {
                height: 80px;
                width: 80px;
                background-image: url('${blocky_images.blocky}');
                background-size: contain;
                position: absolute;
                right: 8px;
                bottom: 100px;
            }
            .preview .blocky.blink {
                background-image: url('${blocky_images.blocky_blink}');
            }
            .preview .blocky > div {
                position: absolute;
                display: none;
                background-color: var(--color-bright_ui);
                color: var(--color-accent_text);
                width: 200px;
                right: -6px;
                bottom: 80px;
                padding: 10px;
                padding-top: 25px;
                border-radius: 8px;
            }
            .preview .blocky > div #blocky_close_button {
                position: absolute;
                top: 0;
                right: 0;
            }
            .preview .blocky > div button {
                background-color: transparent;
                border: 1px solid var(--color-border);
                color: var(--color-accent_text);
                height: 26px;
            }
            #blocky_actions {
                position: unset;
                box-shadow: none;
                margin-top: 16px;
                margin-bottom: 16px;
                max-width: 100%;
            }`
                let blocky = document.createElement('div');
                blocky.className = 'blocky';

                function blink() {
                    blocky.classList.add('blink');
                    setTimeout(() => {
                        blocky.classList.remove('blink');
                        setTimeout(blink, Math.randomab(3000, 5000));
                    }, Math.randomab(140, 400));
                }
                blink();
                document.querySelector(".preview").append(blocky);
                let win = $(`<div>
    <i class="material-icons" id="blocky_close_button" title="Close">clear</i>
    <p id="blocky_main_text"></p>
    <div id="blocky_actions" class="contextMenu"></div>
    <button id="blocky_hide_button">Disable Blocky</button>
</div>`)[0];
                blocky.append(win);

                function showBlocky() {
                    win.style.display = 'block';

                    let actions, text;
                    if (Modes.paint) {
                        actions = ['create_texture', 'import_palette', 'lock_alpha'];
                        text = `It looks like you're painting a texture.\nWould you like help?`;
                    } else if (Modes.animate) {
                        actions = ['add_animation', 'add_keyframe', 'play_animation'];
                        text = `It looks like you're making an animation.\nWould you like help?`;
                    } else {
                        actions = ['open_model', 'add_cube', 'add_group'];
                        text = `It looks like you're making a model.\nWould you like help?`;
                    }

                    win.children.blocky_actions.innerHTML = '';
                    actions.forEach(id => {
                        let action = BarItems[id];
                        var clone = $(action.menu_node).clone(true, true).get(0);
                        clone.onclick = (e) => {
                            if (!Condition(action.condition)) return;
                            action.trigger(e)
                        }
                        win.children.blocky_actions.append(clone);
                    })
                    win.children.blocky_main_text.innerText = text;
                }
                blocky.addEventListener('click', (event) => {
                    if (event.target == blocky) {
                        showBlocky();
                    }
                })
                Blockbench.on('select_mode', (e) => {
                    if (win.style.display === 'block') showBlocky();
                })
                blocky.addEventListener('mouseenter', e => {
                    if (win.style.display !== 'block') {
                        $(blocky).effect('bounce');
                    }
                })
                win.children.blocky_close_button.addEventListener('click', event => {
                    win.style.display = 'none';
                })
                win.children.blocky_hide_button.addEventListener('click', event => {
                    blocky.remove();
                })
            }
        },
        onuninstall() {
            document.querySelector(".blocky").remove();
        }
    });
})();